  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112300 includes chemical,
  discrete sample, physical and profile data collected from Soyo Maru in the North
  Pacific Ocean from 1997-08-20 to 1997-08-27 and retrieved during cruise PACIFICA_49SO19970820
  and SY9708. These data include ALKALINITY, DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, SALINITY, SILICATE and WATER TEMPERATURE.
  The instruments used to collect these data include CTD, Coulometer for DIC measurement
  and bottle. These data were collected by Tsuneo Ono and Katsuyuki Sasaki of National
  Research Institute of Fisheries Science as part of the PACIFICA_49SO19970820 data
  set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
